CREATE SCHEMA IF NOT EXISTS test_tenant_mod_entities_links;

CREATE TABLE IF NOT EXISTS test_tenant_mod_entities_links.authority
(
    id uuid NOT NULL,
    natural_id character varying(250) NOT NULL,
    source_file_id uuid,
    source character varying(250),
    heading character varying(2500),
    heading_type character varying(250),
    _version integer,
    subject_heading_code character(1),
    sft_headings jsonb,
    saft_headings jsonb,
    identifiers jsonb,
    notes jsonb,
    deleted boolean DEFAULT false,
    created_date timestamp without time zone NOT NULL,
    updated_date timestamp without time zone NOT NULL,
    created_by_user_id uuid NOT NULL,
    updated_by_user_id uuid NOT NULL,
    CONSTRAINT pk_authority_storage PRIMARY KEY (id)
);

